import React from 'react'
import Navigation from './Components/NavLeiste'
import Item from './Components/itemBox'
import { Box, styled } from "@mui/material";

const App = () => {
    return(
        <>
        <Box>
            <Navigation />
            <Item />
        </Box>
        </>
    )
}

export default App;
